import { Home } from "./testComponent/Home"
import { Page1 } from "./testComponent/Page1";
import { Page2 } from "./testComponent/Page2";

export const Menu = () => {
  const router = useHistory();

  const moveHome = () => router.push(Home);
  const movePage1 = () => router.push(Page1);
  const movePage2 = () => router.push(Page2);

  return(<>
    <button onClick = {moveHome}>Home</button>
    <button onClick = {movePage1}>Page1</button>
    <button onClick = {movePage2}>Page2</button>
  </>); 
};
